window._config = {
    cognito: {
        userPoolId: 'us-east-1_HayyGbp0O',
        region: 'us-east-1',
		clientId: '7jcttiirnot4cmdas70t8q2kst'
    },
};
var email;
var password;
var firstname;
var lastname;
var poolData;

function registerButton() {
  firstname =  document.getElementById("firstname").value;
  lastname =  document.getElementById("lastname").value;	
  email = document.getElementById("email").value;
  password =  document.getElementById("new_password").value;
  
  poolData = {
      UserPoolId : _config.cognito.userPoolId, // Your user pool id here
      ClientId : _config.cognito.clientId // Your client id here
    };		
  var userPool = new AmazonCognitoIdentity.CognitoUserPool(poolData);

  var attributeList = [];
  
  var attrFirstname = {
    Name : 'given_name', 
    Value : firstname, //get from form field
  };
  
  var attrLastname = {
    Name : 'family_name', 
    Value : lastname, //get from form field
  };

  var attributeFirstname = new AmazonCognitoIdentity.CognitoUserAttribute(attrFirstname);
  var attributeLastname = new AmazonCognitoIdentity.CognitoUserAttribute(attrLastname);
  
  
  attributeList.push(attributeFirstname);
  attributeList.push(attributeLastname);

  userPool.signUp(email, password, attributeList, null, function(err, result){
    if (err) {
      alert(err.message || JSON.stringify(err));
      return;
    }
    cognitoUser = result.user;
    console.log('user name is ' + cognitoUser.getUsername());
    //change elements of page
    alert('success');
  });
}

$('#signup_form').on('click', function(){
  registerButton();
});
jQuery.validator.addMethod("alphanumeric", function(value, element) {
  return this.optional(element) || (value.match(/[a-zA-Z]/) && value.match(/[0-9]/));
}, "Password must contain at least one numeric and one alphabetic character.");

$(function() {
  // Initialize form validation on the registration form.
  // It has the name attribute "registration"
  $("form[name='signin']").validate({
    // Specify validation rules
    rules: {
      // The key name on the left side is the name attribute
      // of an input field. Validation rules are defined
      // on the right side
      email: {
        required: true,
        // Specify that email should be validated
        // by the built-in "email" rule
        email: true
      },
      password: {
        required: true
      }
    },
    // Specify validation error messages
    messages: {
      password: {
        required: "Please enter a password",
        minlength: "Your password must be at least 5 characters long"
      },
      email: "Please enter a valid email address"
    },
    // Make sure the form is submitted to the destination defined
    // in the "action" attribute of the form when valid
    submitHandler: function(form) {
      form.submit();
    }
  });
  $("form[name='signup']").validate({
    // Specify validation rules
    rules: {
      // The key name on the left side is the name attribute
      // of an input field. Validation rules are defined
      // on the right side
      firstname: "required",
      lastname: "required",
      email: {
        required: true,
        email: true
      },
      new_password: {
        required: true,
        minlength: 8,
        alphanumeric: true
      },
      confirm_password: {
        required: true,
        minlength: 8,
        equalTo: "#new_password"
      }
    },
    // Specify validation error messages
    messages: {
      firstname: "Please enter your firstname",
      lastname: "Please enter your lastname",
      email: "Please enter a valid email address",
      new_password: {
        required: "Please enter a new password",
        minlength: "Your password must be at least 8 characters long"
      },
      confirm_password: {
        required: "Please confirm the password",
        equalTo: "Password does not match"
      }
    },
    // Make sure the form is submitted to the destination defined
    // in the "action" attribute of the form when valid
    submitHandler: function(form) {
      $('#signup_form').on('click', function(){
        form.submit();
      });
    }
  });
});